    data: |
      SELECT DISTINCT 68 * COUNT ( * ) - + 19 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q6810.out
    data: |
      593
